import Node from './Node';

import list_insert from './list_insert';
import list_remove from './list_remove';
import list_concatenate from './list_concatenate';
import list_reset_parent from './list_reset_parent';

import consolidate from './consolidate';
import cut from './cut';
import cascading_cut from './cascading_cut';

/**
 * See CLRS09 Chapter 19 on the Fibonacci Heap.
 */
export default class FibonacciHeap {
	/**
	 * Make-heap: creates a new empty heap.
	 *
	 * To make an empty Fibonacci heap, the MAKE-FIB-HEAP procedure
	 * allocates and returns the Fibonacci heap object H, where H.n = 0 and
	 * H.min = NIL ; there are no trees in H. Because t(H) = 0 and m(H) = 0,
	 * the potential of the empty Fibonacci heap is pot(H) = 0. The amortized
	 * cost of MAKE-FIB-HEAP is thus equal to its O(1) actual cost.
	 */
	constructor(compare) {
		this.compare = compare; // Comparison function
		/**
		 * We access a given Fibonacci heap H by a pointer H.min to the root of
		 * a tree containing the minimum key; we call this node the minimum
		 * node of the Fibonacci heap. If more than one root has a key with the
		 * minimum value, then any such root may serve as the minimum node.
		 * When a Fibonacci heap H is empty, H.min is NIL.
		 */
		this.min = null;
	}

	/**
	 * Find-min: simply return the top element of the heap.
	 */
	head() {
		if (this.min === null) return undefined;
		return this.min.value;
	}

	/**
	 * Minimum: return a pointer to the element whose key is minimum
	 *
	 * The minimum node of a Fibonacci heap H is given by the pointer H.min, so
	 * we can find the minimum node in O(1) actual time. Because the potential
	 * of H does not change, the amortized cost of this operation is equal to
	 * its O(1) actual cost.
	 */
	headreference() {
		return this.min;
	}

	/**
	 */
	pop() {
		const min = this.popreference();
		return min === null ? undefined : min.value;
	}

	/**
	 * FIB-HEAP-EXTRACT-MIN(H):
	 *
	 * Extracting the minimum node
	 *
	 * The process of extracting the minimum node is the most complicated of
	 * the operations presented in this section. It is also where the delayed
	 * work of consolidating trees in the root list finally occurs. The
	 * following pseudocode extracts the minimum node. The code assumes for
	 * convenience that when a node is removed from a linked list, pointers
	 * remaining in the list are updated, but pointers in the extracted node
	 * are left unchanged. It also calls the auxiliary procedure CONSOLIDATE,
	 * which we shall see shortly.
	 */
	popreference() {
		const z = this.min;
		if (z === null) return null;
		if (z.children !== null) {
			list_reset_parent(z.children);
			list_concatenate(z, z.children);
		}

		if (z === z.next) this.min = null;
		else {
			list_remove(z);
			this.min = consolidate(this.compare, z.next);
		}

		z.next = z; // (Re)move this?
		z.prev = z;
		z.children = null;
		z.degree = 0;
		z.mark = false;
		return z;
	}

	/**
	 * Create a new node for the inserted element and put it into the heap.
	 */
	push(value) {
		const node = new Node(value);
		return this.pushreference(node);
	}

	/**
	 * Insert: insert new node.
	 * /!\ ref.next = ref.prev = ref which means all references that are
	 * external to the tree must reset .next and .prev and one must not call
	 * FibonacciHeap#pushreference with an internal reference from this tree or
	 * another, except the root of another tree.
	 *
	 * Change in potential is 1. Therefore amortized cost is O(1).
	 */
	pushreference(ref) {
		if (this.min === null) {
			// Create a root list for H containing just x (by precondition)
			this.min = ref;
		} else {
			// This.min != null != ref
			// Insert x into H's root list
			list_insert(this.min, ref);
			// Update minimum
			if (this.compare(ref.value, this.min.value) < 0) {
				this.min = ref;
			}
		}

		return ref;
	}

	/**
	 * Union: Uniting two Fibonacci heaps
	 *
	 * The following procedure unites Fibonacci heaps H_1 and H_2, destroying
	 * H_1 and H_2 in the process. It simply concatenates the root lists of H_1
	 * and H_2 and then determines the new minimum node. Afterward, the objects
	 * representing H_1 and H_2 will never be used again.
	 *
	 * /!\ Assumes the same comparison function is used in both trees.
	 *
	 * Change in potential is zero. Amortized cost is O(1), the actual cost.
	 */
	meld(other) {
		const ref = other.min;
		if (ref === null) return;
		if (this.min === null) this.min = ref;
		else {
			// This.min != null != ref
			// Concatenate the root list of H_2 with the root list of H
			list_concatenate(this.min, ref);
			// Update minimum
			if (this.compare(ref.value, this.min.value) < 0) {
				this.min = ref;
			}
		}
	}

	/**
	 * Synonym for FibonacciHeap#meld.
	 * TODO Remove this.
	 */
	merge(other) {
		this.meld(other);
	}

	/**
	 * @param {Node} ref Non-null internal node object.
	 * @param {Object} value The new value for ref.
	 */
	update(ref, value) {
		const d = this.compare(value, ref.value);

		if (d < 0) this.decreasekey(ref, value);
		else if (d > 0) this.increasekey(ref, value);
		else ref.value = value;
	}

	/**
	 * FIB-HEAP-DECREASE-kEY:
	 * @param {Node} ref Non-null internal node object.
	 * @param {Object} value The new value for ref.
	 */
	decreasekey(ref, value) {
		ref.value = value;
		if (ref !== this.min) {
			// This.min != null, ref != null
			const y = ref.parent;
			if (y !== null && this.compare(ref.value, y.value) < 0) {
				cut(ref, y);
				list_insert(this.min, ref);
				for (const x of cascading_cut(y)) list_insert(this.min, x);
			}

			if (this.compare(ref.value, this.min.value) < 0) {
				this.min = ref;
			}
		}
	}

	/**
	 * Increase-key: remove the item at the key to be increased, replace
	 * the key with a larger key, then push the result back into the heap.
	 *
	 * @param {Node} ref Non-null internal node object.
	 * @param {Object} value The new value for ref.
	 *
	 */
	increasekey(ref, value) {
		this.delete(ref);

		ref.value = value;

		this.pushreference(ref);
	}

	/**
	 * Delete
	 * ref must be internal
	 * ref.prev and ref.next get reset to null
	 */
	delete(ref) {
		if (ref !== this.min) {
			// This.min != null, ref != null
			const y = ref.parent;
			if (y !== null) {
				cut(ref, y);
				list_insert(this.min, ref);
				for (const x of cascading_cut(y)) list_insert(this.min, x);
			}

			this.min = ref;
		}

		this.popreference();
	}
}

import cut from './cut';

export default function* cascading_cut(y) {
	while (true) {
		const z = y.parent;
		if (z === null) break;
		if (!y.mark) {
			y.mark = true;
			break;
		}

		cut(y, z);
		yield y;
		y = z;
	}
}

import list_insert from './list_insert';
import fib_heap_link from './fib_heap_link';

/**
 * CONSOLIDATE: Consolidate the root list of a heap.
 *
 * The next step, in which we reduce the number of trees in the Fibonacci heap,
 * is consolidating the root list of H, which the call CONSOLIDATE(H)
 * accomplishes. Consolidating the root list consists of repeatedly executing
 * the following steps until every root in the root list has a distinct degree
 * value:
 *
 *   1. Find two roots x and y in the root list with the same degree. Without
 *   loss of generality, let x.key <= y.key.
 *
 *   2. Link y to x: remove y from the root list, and make y a child of x by
 *   calling the FIB-HEAP-LINK procedure. This procedure increments the
 *   attribute x:degree and clears the mark on y.
 *
 * The procedure CONSOLIDATE uses an auxiliary array A[0..D(H.n)] to
 * keep track of roots according to their degrees. If A[i] = y, then y is
 * currently a root with y.degree = i. Of course, in order to allocate the
 * array we have to know how to calculate the upper bound D(H.n) on the maximum
 * degree, but we will see how to do so in Section 19.4.
 *
 * @param compare Comparison function.
 * @param l Root list.
 */
export default function consolidate(compare, l) {
	const A = [];

	let next = l;

	do {
		let x = next;
		next = x.next;
		let d = x.degree;

		let n = d - A.length;
		if (n >= 0) {
			while (n-- > 0) A.push(null);
			A.push(x);
		} else {
			while (A[d] !== null) {
				let y = A[d]; // Another node with the same degree as x
				if (compare(y.value, x.value) < 0) {
					// CANNOT EXCHANGE VALUES BECAUSE THAT WOULD INVALIDATE
					// EXISTING POINTERS
					y = x;
					x = A[d];
				}

				fib_heap_link(y, x);
				A[d] = null; // Put before fib_heap_link if using x.degree ?
				++d;
				if (d === A.length) {
					A.push(null);
					break;
				}
			}

			A[d] = x;
		}
	} while (next !== l);

	let min = null;

	for (const x of A) {
		if (x === null) continue;
		if (min === null) {
			// Create a root list for H containing just A[i]
			x.next = x;
			x.prev = x;
			min = x;
		} else {
			// Insert A[i] into H's root list
			list_insert(min, x);
			// Update minimum if necessary
			if (compare(x.value, min.value) < 0) min = x;
		}
	}

	return min;
}

import list_remove from './list_remove';

export default function cut(x, y) {
	if (x === x.next) y.children = null;
	else {
		y.children = x.next;
		list_remove(x);
	}

	--y.degree;
	x.parent = null;
	x.mark = false;
}

import list_insert from './list_insert';

/**
 * FIB-HEAP-LINK
 *
 * Precondition: y is in the root list of some heap.
 */
export default function fib_heap_link(y, x) {
	// List_remove(y); // NOT NECESSARY SINCE y IS ALWAYS FROM ROOT LIST
	// make y a child of x
	if (x.children === null) {
		y.next = y;
		y.prev = y;
		x.children = y;
	} else {
		list_insert(x.children, y);
	}

	y.parent = x;
	++x.degree; // Increment x.degree
	y.mark = false; // Unmark y
}

import Node from './Node';
import FibonacciHeap from './FibonacciHeap';

export default FibonacciHeap;

export {Node, FibonacciHeap};

export default function list_concatenate(x, y) {
	// FROM x - b - c - d - x        y - f - g - h - y
	//   TO x - b - c - d - y - f - g - h - x
	const d = x.prev;
	const h = y.prev;
	d.next = y; // D -> y
	x.prev = h; // H <- x
	y.prev = d; // D <- y
	h.next = x; // H -> x
}

/**
 * Optimization of list_concatenate when x contains a single element.
 * Works even if x has dangling pointers x.next and x.prev.
 */
export default function list_insert(a, x) {
	// FROM a - b - c - d - a        x
	//   TO a - b - c - d - x - a
	const d = a.prev;
	x.next = a; // X -> a
	x.prev = d; // D <- x
	d.next = x; // D -> x
	a.prev = x; // X <- a
}

export default function* list_iter(children) {
	let next = children;

	do {
		const x = next;
		next = x.next;
		yield x;
	} while (next !== children);
}

/**
 * /!\ pointers in the extracted node are left unchanged
 * /!\ y will have dangling pointers after removal if not single element
 */
export default function list_remove(y) {
	y.prev.next = y.next;
	y.next.prev = y.prev;
}

export default function list_reset_parent(children) {
	let next = children;

	do {
		const x = next;
		next = x.next;
		x.parent = null;
	} while (next !== children);
}

